import React from 'react';
import {connect} from 'react-redux';
import {updateCompleteStart} from '../../redux/booking/booking-action';
import {Button , Popconfirm , message} from 'antd';
const popConfirmContainer =  () => (
      <Popconfirm
      title="Are you sure Is Complete ?"
      okText="Yes"
      cancelText="No"
      onCancel  = { () => message.error('U click on No')}

    >
      <Button type="primary">Complete</Button>
    </Popconfirm>
)


export const columns = [
  {
    title: 'Date',
    dataIndex: 'createAt',
    sorter: (a, b) => a.date - b.date,
    width: 100,
    fixed: 'left',
  },
  {
    title: 'Name',
    dataIndex: 'name',
    width: 150,
    fixed: 'left',
  },
  {
    title: 'Phone Customer',
    dataIndex: 'phoneNumber',
    ellipsis: true,
    width: 150,
  },
  {
    title: 'Address Ship',
    dataIndex: 'address',
    ellipsis: true,
    width: 150,
  },
  {
    title: 'BOX_NO',
    dataIndex: 'boxNo',
    width: 150,
    render: () => (
      <p>BOX NO</p>
    )
  },
  {
    title: 'PACKAGE_QTY',
    dataIndex: 'quantity',
    ellipsis: true,
    width: 150,
  },
  {
    title: 'ORDER_ITEM',
    dataIndex: 'idProduct',
    ellipsis: true,
    width: 150,
  },
  {
    title: 'ITEM_DESCRIPTION_EN',
    dataIndex: 'nameEN',
    ellipsis: true,
    width: 200,
  },
  {
    title: 'ITEM_DESCRIPTION',
    dataIndex: 'nameVN',
    ellipsis: true,
    width: 600  ,
  },
  {
    title: 'ORDER_QUANTITY',
    dataIndex: 'quantity',
    ellipsis: true,
    width: 150,
  },
  {
    title: 'UOM',
    dataIndex: 'uom',
    width: 150,
  },
  {
    title: 'ORDER_NET_WEIGHT',
    dataIndex: 'weight',
    ellipsis: true,
    width: 250,
  },
  {
    title: 'ORDER_GROSS_WEIGHT',
    dataIndex: 'totalWeight',
    ellipsis: true,
    width: 250,
  },
  {
    title: 'ITEM_FACTORY_COUNTRY',
    dataIndex: 'origin',
    ellipsis: true,
    width: 250,
  },
  {
    title: 'AMOUNT',
    dataIndex: 'priceUSD',
    width: 150,
  },
  {
    title: 'ORDER_CURR_CODE',
    dataIndex: 'orderCurrCode',
    ellipsis: true,
    width: 200,
  },
  {
    title: 'SHIP_FROM_PORT',
    dataIndex: 'shipFormPort',
    ellipsis: true,
    width: 200,
  },
  {
    title: "isComplete",
    dataIndex: "isComplete",
    key: "delete",
    ellipsis: true,
    width: 150,
    fixed: 'right',
    render: () => (
       <PopConfirmContainer/>
    )

  }
];


const mapDispatchToProps = dispatch => ({
  updateCompleteStart: () => dispatch(updateCompleteStart())
})

connect(mapDispatchToProps)(popConfirmContainer);
